import React from 'react';
import { motion } from 'framer-motion';
import './Skills.css';

const containerVariants = {
    hidden: { opacity: 0, y: -20 },
    visible: {
        opacity: 1,
        y: 0,
        transition: {
            staggerChildren: 0.2,
        }
    }
};

const childVariants = {
    hidden: { opacity: 0, y: -20 },
    visible: { opacity: 1, y: 0 }
};

const Skills = () => {
    return (
        <section id="skills" className="skills-section">
            <motion.div
                initial="hidden"
                animate="visible"
                variants={containerVariants}
            >
                <motion.h3 variants={childVariants}>Skills</motion.h3>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>Programming Languages</h4>
                    <p>HTML, CSS, JavaScript, Java, Python</p>
                </motion.div>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>Frameworks</h4>
                    <p>Node JS, Express JS, React JS, Redux, Redux-toolkit, Bootstrap, UI/UX-design</p>
                </motion.div>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>Databases</h4>
                    <p>MongoDB, MySQL</p>
                </motion.div>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>Version Control Tools</h4>
                    <p>GIT</p>
                </motion.div>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>IDE/Tools</h4>
                    <p>Visual Studio, Postman, MongoDB-Compass, Eclipse, Figma</p>
                </motion.div>
                <motion.div className="skills-category" variants={childVariants}>
                    <h4>Operating Systems</h4>
                    <p>Windows-10</p>
                </motion.div>
            </motion.div>
        </section>
    );
};

export default Skills;
